import qr from 'qr-image';

const bg = `data:image/png;base64,`;

export default {
	async fetch(request, env, ctx) {
		async function gatherResponse(response) {
			const { headers } = response;
			const contentType = headers.get('content-type') || '';
			if (contentType.includes('application/json')) {
				return JSON.parse(JSON.stringify(await response.json()));
			}
			return response.text();
		}

		if (request.method === 'POST' || (request.method === 'GET' && request.url.includes('/user/'))) {
			let username;

			try {
				const body = request.method === 'POST' ? await request.json() : { username: request.url.split('/user/').pop() };
				username = body.username;
			} catch (e) {
				return new Response('Invalid JSON', { status: 400, statusText: 'Bad Request' });
			}

			if (!username) {
				return new Response('Missing username', { status: 400, statusText: 'Bad Request' });
			}

			const token = env.GITHUB_TOKEN;
			console.log(token);
			// const username = "8rxn";
			const userDataUrl = `https://api.github.com/users/${username}`;
			const starredUrl = `https://api.github.com/users/${username}/starred`;
			const prUrl = `https://api.github.com/search/issues?q=is:pr+author:${username}`;
			const issuesUrl = `https://api.github.com/search/issues?q=is:issue+author:${username}`;

			const headers = {
				Authorization: `token ${token}`,
				'X-GitHub-Api-Version': '2022-11-28',
				'User-Agent': request.headers.get('User-Agent') || 'Git Card Worker',
			};

			try {
				const [userDataResponse, starredResponse, prResponse, issueResponse] = await Promise.all([
					fetch(userDataUrl, { method: 'GET', headers: headers }),
					fetch(starredUrl, { method: 'GET', headers: headers }),
					fetch(prUrl, { method: 'GET', headers: headers }),
					fetch(issuesUrl, { method: 'GET', headers: headers }),
				]);

				if (!userDataResponse.ok || !starredResponse.ok) {
					throw new Error(`HTTP error! User: ${userDataResponse.status}, Starred: ${starredResponse.status}`);
				}

				const userData = await gatherResponse(userDataResponse);
				const starredData = await gatherResponse(starredResponse);
				const prData = await gatherResponse(prResponse);
				const issueData = await gatherResponse(issueResponse);

				console.log(userData, starredData, prData, issueData);

				const qrbuffer = Buffer.from(qr.imageSync(userData.blog || userData.html_url)).toString('base64');

				const qrdata = `data:image/png;base64,${qrbuffer}`;

				console.log(qrdata);
				const svg = `
				<svg width="1280" height="640" xmlns="http://www.w3.org/2000/svg">
    <!-- Background Rectangle -->
    <image href="${bg}" x="0" y="0" height="640px" width="1280px" />

    <!-- Text Elements -->
    <text x="640" y="100" font-family="Giest, Courier New, Serif" font-size="60" fill="#fafafa" text-anchor="start">${userData.name}</text>
    <text x="640" y="150" font-family="Giest, Courier New, Serif" font-size="25" fill="#fafafa" text-anchor="start">@${userData.login}</text>
    <text x="640" y="200" font-family="Giest, Courier New, Serif" font-size="35" fill="#fafafa" text-anchor="start">
        ${userData.public_gists} gists    ${userData.followers} followers
    </text>
    <text x="640" y="340" font-family="Giest, Courier New, Serif" font-size="35" fill="#fafafa" text-anchor="start">
        ${userData.public_repos} repos   ${starredData.length} stars  
    </text>
    <text x="640" y="410" font-family="Giest, Courier New, Serif" font-size="35" fill="#fafafa" text-anchor="start">
        ${prData.total_count} PRs raised
    </text>
    <text x="640" y="490" font-family="Giest, Courier New, Serif" font-size="35" fill="#fafafa" text-anchor="start">
        ${issueData.total_count} issues created
    </text>

    <!-- QR Code (Placeholder) -->
    <rect x="10" y="10" width="80" height="80" fill="black" />
	<image href="${qrdata}" x="15" y="15" height="100px" width="100px" />
    <text x="15" y="50" font-family="Giest, Courier New, Serif" font-size="12" fill="white" text-anchor="start">QR Code</text>
</svg>`;

				return new Response(svg, {
					headers: {
						'Content-Type': 'image/svg+xml',
					},
				});
			} catch (e) {
				return new Response(e.message, { status: 500, statusText: 'Internal Server Error' });
			}
		}

		return new Response('Git Card Worker!', { status: 405, statusText: 'Method Not Allowed' });
	},
};
